import '../App.css';
import { Container, Row, Col, Form, FormGroup, Label, Input, Button, Card } from "reactstrap";
import { useNavigate, BrowserRouter as Router, Route, Routes } from "react-router-dom";


function Lab() {
    const navigate = useNavigate();
    const password = "123";
  
    function bbtnclk() {
    
        navigate("/Password");
    
    }

    return (
        <div className='bor bg-dark'>
            <Container >
                <Row>
                    <Col className='borr'>
                        <Button color="danger">
                            back
                        </Button>
                    </Col>

                    <Col className='borl'>
                        right
                    </Col>
                </Row>
            </Container>



            <Container>
                <Row>
                    <Col className='borr'>
                        left
                    </Col>

                    <Col className='borl'>
                        right
                    </Col>
                </Row>
            </Container>

        </div>

    );
}

export default Lab;
